var results={animation:3.5},buildListResults=[],buildListHeader=[];function getData(){$.ajax({url:AppURL.results,type:"GET",dataType:"json",cache:!0,complete:function(t){var i=t.responseJSON.data_results;results.giaidacbiet=i.giaidacbiet,results.giainhat=i.giainhat,results.giainhi=i.giainhi,results.giaikhuyenkhich=i.giaikhuyenkhich,results.bgimg=t.responseJSON.bgimg,results.data_titles=t.responseJSON.data_titles,results.columnTitle=t.responseJSON.columnTitle.split(","),results.bgimg&&setTimeout(function(){$("body").css({"background-image":"url("+results.bgimg+")"})},200),buildHeader(),getGiaiThuong()}})}function buildHeader(){buildListHeader.push('<th scope="col">STT</th>');for(var t=0;t<results.columnTitle.length-3;t++)buildListHeader.push('<th scope="col">'+results.columnTitle[t+3]+"</th>")}function putData(t,i,s){buildListResults.push('<tr><td colspan="5" class="namegiai">'+s+"</td></tr>");for(var a=0;a<t.length;a++){var e=t[a].split(";"),l=[];l.push("<td>"+(a+1)+"</td>");for(var u=0;u<results.columnTitle.length-3;u++)l.push("<td>"+e[u+3]+"</td>");var r="<tr>"+l+"<tr>";buildListResults.push(r)}}function getGiaiThuong(){putData(results.giaidacbiet,"giaidacbiet",results.data_titles.giaidacbiet),putData(results.giainhat,"giainhat",results.data_titles.giainhat),putData(results.giainhi,"giainhi",results.data_titles.giainhi),putData(results.giaikhuyenkhich,"giaikhuyenkhich",results.data_titles.giaikhuyenkhich),$("#lists-op table thead tr").html(buildListHeader),$("#lists-op table tbody").html(buildListResults)}getData();